import React from "react";
import { useDispatch } from "react-redux";
import { incrementCell } from "../../../../../../redux/actions";

const IncrementCell = ({ id, value, percent }) => {
   const dispatch = useDispatch();

   return (
      <td onClick={() => dispatch(incrementCell(id, value))}>
         {value + "/" + percent}
      </td>
   );
};

export default IncrementCell;
